import Vue from 'vue';
import App from './App.vue';  // Ruta correcta si App.vue está en src
import 'bootstrap/dist/css/bootstrap.css';  // Si usas Bootstrap
import './assets/css/estilos.css';  // Ruta a tu archivo de estilos

Vue.config.productionTip = false;

new Vue({
  render: h => h(App)
}).$mount('#app');
